import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo.png} className="App-logo" alt="logo" /> <h1>Our Menu</h1>
      </header>
    </div>
  );
}

export default App;
